INSERT INTO `clinics` (`id`, `name`, `introductionHTML`, `introductionMarkdown`, `description`, `image`, `createdAt`, `updatedAt`, `deletedAt`) VALUES
(1, 'Gói khám sức khỏe tổng quát cơ bản cho nữ', '<p>Gói khám bao gồm: Khám lâm sàng, Xét nghiệm máu, xét nghiệm chức năng gan, thận, chức năng chuyển hóa, chụp Xquang, siêu âm ổ bụng, điện tim. \r\nGói khám tại Phòng khám Bệnh viện Đại học Y dược 1\r\nGói khám dành cho đối tượng trên 15 tuổi.</p>', 'Gói khám bao gồm: Khám lâm sàng, Xét nghiệm máu, xét nghiệm chức năng gan, thận, chức năng chuyển hóa, chụp Xquang, siêu âm ổ bụng, điện tim. \r\nGói khám tại Phòng khám Bệnh viện Đại học Y dược 1\r\nGói khám dành cho đối tượng trên 15 tuổi.', '', 'usa-az.jpg', '2020-11-13 19:44:36', '2020-11-13 20:44:20', '0000-00-00 00:00:00'),
(2, 'Gói khám sức khỏe tổng quát nâng cao dành cho nam', '<p>Gói khám giúp phát hiện: các vấn đề về thận, tiền liệt tuyến, tuyến giáp, tiết niệu, gan, mật, tim mắt, tai mũi họng, răng, bất thường về các loại tế bào máu, bệnh viêm gan siêu vi B, viêm gan siêu vi C....Kiểm tra tổng thể\r\nĐối tượng: Nam, trên 15 tuổi</p>', 'Gói khám giúp phát hiện: các vấn đề về thận, tiền liệt tuyến, tuyến giáp, tiết niệu, gan, mật, tim mắt, tai mũi họng, răng, bất thường về các loại tế bào máu, bệnh viêm gan siêu vi B, viêm gan siêu vi C....Kiểm tra tổng thể\r\nĐối tượng: Nam, trên 15 tuổi', 'Gói khám giúp phát hiện: các vấn đề về thận, tiền liệt tuyến, tuyến giáp, tiết niệu, gan, mật, tim mắt, tai mũi họng, răng, bất thường về các loại tế bào máu, bệnh viêm gan siêu vi B, viêm gan siêu vi C....Kiểm tra tổng thể\r\nĐối tượng: Nam, trên 15 tuổi', 'mayo-clinic-health-system.jpg', '2020-11-13 19:44:36', '2020-11-13 20:46:01', '0000-00-00 00:00:00'),
