INSERT INTO `specializations` (`id`, `name`, `description`, `image`, `createdAt`, `updatedAt`, `deletedAt`) VALUES
(8, 'Thần kinh', 'Chuyên khoa Thần kinh thuộc khối Y học lâm sàng, là một lĩnh vực gồm nội khoa và ngoại khoa,  giữ chức năng khám, chẩn đoán, tư vấn, điều trị chuyên sâu và phẫu thuật những bệnh lý có liên quan đến yếu tố thần kinh.\r\nChuyên khoa Nội Thần kinh chuyên điều trị các bệnh: đau đầu, đau vai gáy, đau thắt lưng hông, rối loạn tiền đình, chóng mặt do thiếu máu não, rối loạn về giấc ngủ, khám thần kinh và điều trị liệt dây 7 ngoại vi, liệt nửa người do đột quỵ não, sa sút trí tuệ, rối loạn vận động như bệnh Parkinson, động kinh, viêm não tủy, viêm đa dây thần kinh, các bệnh gây thoái hoá hệ thần kinh, nhiễm trùng thần kinh, bệnh lý thần kinh ngoại biên, nhiễm độc thần kinh, rối loạn chuyển hóa,…\r\nCác phương pháp điều trị đang được áp dụng tại chuyên khoa Nội Thần kinh:\r\n\r\nXét nghiệm để chẩn đoán chính xác: sàng lọc máu, nước tiểu, di truyền; điện não đồ; điện cơ; EMG (hoạt động điện trong cơ bắp)\r\nChẩn đoán hình ảnh: chụp cắt lớp vi tính (CT scan); cộng hưởng từ (MRI); chụp cắt lớp phát xạ positron (PET); chụp cắt lớp phát xạ đơn photon (SPECT).\r\nChuyên khoa Ngoại thần kinh thực hiện các phẫu thuật u não, u dây thần kinh, u cột sống, chấn thương sọ não và cột sống; vi phẫu thuật mạch máu não trong co giật nửa mặt; vi phẫu thuật mạch máu não trong đau dây thần kinh v.v.. ', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fthankinh.png?alt=media&token=3ccc51a0-f534-45e7-bc5d-581ac0ce846c', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, 'Cơ xương khớp', 'Khoa Cơ xương khớp chuyên điều trị các bệnh về cơ xương khớp, tư vấn điều trị và theo dõi định kỳ. Bác sỹ chuyên khoa xương khớp thăm khám cho bệnh nhân các lứa tuổi khác nhau.\r\nChuyên khoa xương khớp điều trị nhiều bệnh lý hay gặp như:\r\n    -  Bệnh gút; bệnh giả gút  (goutte, pseudogoutte)\r\n    -  Viêm khớp nhiễm khuẩn (arthrite infectieuse )\r\n    -  Viêm khớp phản ứng (arthrite resactive)\r\n    -  Viêm khớp dạng thấp ( Polyarthrite rhumatoïde)\r\n    -  Thoái hóa khớp (arthrose )\r\n   - Các bệnh lý về gân cơ: viêm quanh khớp vai (tendinite de l’epaule), viêm lồi cầu xương cánh tay (epicondylite), viêm mỏm châm quay ( syndrome de De Quervain), ngón tay lò xo (doigt a resort ), viêm gân cơ mông nhỡ (tendinite du moyen fessier), hội chứng đường hầm cổ tay, chân ( syndrome du canal carpien, canal tarsien) …\r\n', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fcoxuongkhop.png?alt=media&token=e6ab3c36-cc04-41fc-9d7d-8575a3874ac4', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, 'Tiêu hóa', 'Khoa tiêu hoá là một chuyên khoa thuộc nội khoa chuyên điều trị các bệnh về tiêu hoá, rối loạn chức năng tiêu hoá và các cơ quan nội tạng. Ngoài ra, các bác sĩ chuyên khoa Tiêu hoá cố vấn nhiều chuyên khoa ngoài lĩnh vực trong vấn đề điều trị do đặc thù của bệnh lý tiêu hoá, đôi khi là nguồn gốc của nhiều bệnh lý khác có liên quan.\r\nKhám và chữa các bệnh cấp và mạn tính:\r\n- Viêm loét dạ dày - tá tràng\r\n- Trào ngược dạ dày - thực quản\r\n- Hội chứng ruột kích thích Viêm đại tràng\r\n- Nhiễm vi khuẩn HP\r\n- Khám tầm soát ung thư đường tiêu hóa\r\nỨng dụng các phương tiện kỹ thuật hiện đại trong chẩn đoán và tầm soát bệnh: \r\n- Nội soi tiêu hóa\r\n- Siêu âm\r\n- X-quang\r\n- CT Scan\r\n- Chụp Cộng hưởng từ', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Ftieuhoa.png?alt=media&token=aa61b841-4570-4fb6-bfb4-44c400ecf95c', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, 'Tim mạch', 'Chuyên khoa Tim mạch là một ngành quan trọng thuộc khối Y học lâm sàng, giữ chức năng khám, chẩn đoán, tư vấn và điều trị các bệnh lý liên quan đến hệ thống tim mạch, cơ quan quan trọng giúp duy trì sự sống của con người.\r\nChức năng và nhiệm vụ: \r\nCấp cứu, chẩn đoán và điều trị các bệnh Tim mạch; thực hiện các kỹ thuật chẩn đoán, can thiệp tim mạch và nhịp học; tham gia chuẩn bị bệnh nhân và hội chẩn phẫu thuật tim mạch cho bệnh nhân là bộ đội, chính sách, BHYT và bệnh nhân nhân dân.\r\nTham gia công tác đào tạo, nghiên cứu khoa học, hợp tác Quốc tế và chỉ đạo tuyến', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Ftimmach.png?alt=media&token=6a8868de-a66c-410e-8415-e3fb010cdcd4', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(12, 'Tai mũi họng', 'Khoa Tai Mũi Họng là chuyên khoa điều trị các bệnh lý liên quan đến tai, mũi và họng cũng như vùng đầu và cổ. Khoa Tai Mũi Họng cung cấp dịch vụ đa dạng, từ khám bệnh đến thực hiện các loại phẫu thuật phức tạp cho cả trẻ em và người lớn.\r\nĐể điều trị các bệnh lý phức tạp, các bác sĩ tai mũi họng của chúng tôi phối hợp chặt chẽ với các bác sĩ tại các chuyên khoa khác trong bệnh viện như bác sĩ Ngoại Thần kinh và chuyên gia điều trị ung thư.', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Ftaimuihong.png?alt=media&token=d6385508-ed1f-469c-9cd7-8493472b34a3', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(13, 'Ngoại thần kinh cột sống', 'Khoa ngoại cột sống là chuyên khám, chẩn đoán và điều trị các bệnh lý từ đơn giản đến phức tạp về cột sống như gãy lún đốt sống, hẹp ống sống, thoái hóa cột sống, thoát vị đĩa đệm, trượt đốt sống,..\r\nNhờ được áp dụng các phương pháp xâm lấn tối thiểu trong phẫu thuật và điều trị như: phẫu thuật nội soi, phẫu thuật qua da... người bệnh sẽ hồi phục nhanh chóng, từ đó rút ngắn thời gian nằm viện, tối ưu chi phí điều trị và giúp người bệnh sớm trở lại với cuộc sống lao động thường ngày.', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fngoaithankinhcotsong.png?alt=media&token=5644d5be-13a5-498b-b383-d48c7315c111', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(14, 'Sản phụ khoa', 'Sản & Phụ khoa là chuyên khoa về sức khoẻ phụ nữ và các vấn đề liên quan tới bộ phận sinh sản nữ từ khi dậy thì cho đến hết cuộc đời.\r\nKhoa có hai lĩnh vực chủ yếu là: Khả năng sinh sản & sản khoa ,Các bệnh phụ khoa\r\nKhám tư vấn về:\r\nBệnh viêm nhiễm;\r\nThực hiện các biện pháp phòng tránh thai;\r\nRối loạn tiền mãn kinh;\r\nXuất huyết tử cung;\r\nPhát hiện ung thư cổ tử cung và ung thư vú\r\nNgoại khoa, đặc biệt là phẫu thuật phần phụ và phẫu thuật ít xâm lấn:\r\nU xơ tử cung;\r\nSa sinh dục;\r\nSón tiểu;\r\nBệnh lý về vú;\r\nUng thư cổ tử cung và ung thư tử cung;\r\nNội soi u nang buồng trứng\r\nTạo hình tầng sinh môn\r\nMổ nội soi kiểm tra vòi trứng', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fsanphukhoa.png?alt=media&token=16481ec7-9126-48fc-a014-881e6828dc9e', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(15, 'Da liễu', 'Da liễu là chuyên khoa chuyên điều trị các bệnh về da và những phần phụ của da (lông, tóc, móng), các bệnh lý niêm mạc (lưỡi, môi, miệng), các bệnh lý nội khoa có biểu hiện ngoài da, các bệnh lây qua đường tình dục.\r\nCác vấn đề bệnh lý Da liễu được chẩn đoán, điều trị:\r\n    Mụn trứng cá và thâm sau mụn\r\n    Nám, tàn nhanh, sẹo lồi\r\n    Dị ứng mỹ phẩm\r\n    Mề đay mạn tính tái phát\r\n    Các bệnh da thông thường: vẩy nến, tổ dĩa, lang ben, bệnh da nghề nghiệp\r\n    Các bệnh lý về móng\r\n    Rụng tóc, gàu, ngứa da đầu\r\n    Mụn cóc, nốt ruồi, u lành da\r\n    Sinh thiết da trong chẩn đoán bệnh lý về da và tầm soát ung thư da', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fdalieu.png?alt=media&token=982ea0f4-ae85-48d4-9bc7-0c9b5290893d', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(16, 'Sức khỏe tâm thần', 'Khoa Tâm thần  với các thế mạnh trong lĩnh vực khám, đánh giá, thiết lập chẩn đoán; điều trị và tư vấn cho trẻ em có các vấn đề liên quan tới sức khỏe tâm thần như:\r\nRối loạn phổ tự kỷ\r\nRối loạn tăng động giảm chú ý\r\nChậm phát triển tâm thần\r\nRối loạn trầm cảm, rối loạn cảm xúc lưỡng cực\r\nRối loạn lo âu, rối loạn ám ảnh – cưỡng chế, rối loạn liên quan đến stress\r\nRối loạn hành vi, Rối loạn bướng bỉnh chống đối\r\nRối loạn học tập\r\nRối loạn tic\r\nRối loạn giấc ngủ\r\nRối loạn ăn uống\r\nNghiện game, nghiện thuốc lá điện tử, nghiện các chất ma tuý', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fsuckhoetamthan.png?alt=media&token=1440ba6e-7174-4b1e-b7c4-ddce756ed52a', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, 'Hô hấp - Phổi', 'Khoa nội hô hấp (hay phổi học) là chuyên khoa lâm sàng để điều trị các bệnh lý liên quan đến đường thở và phổi. Các vấn đề về hô hấp có thể bao gồm các ca bệnh thường quy như hen suyễn, viêm tiểu phế quản và viêm mũi dị ứng đến các bệnh lý phức tạp như ung thư phổi, lao và bệnh phổi tắc nghẽn mạn tính (COPD).', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fhohapphoi.png?alt=media&token=da67da7b-17c4-42ab-9d71-2009bceaf293', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, 'Ngoại thần kinh', 'Khoa Ngoại thần kinh còn gọi là khoa phẫu thuật thần kinh, giữ chức năng điều trị các bệnh lý liên quan đến yếu tố thần kinh bằng các phương pháp ngoại khoa, bao gồm phẫu thuật nội soi, vi phẫu thuật, can thiệp nội mạch, phẫu thuật tạo hình, mổ và cấy ghép.', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fhohapphoi.png?alt=media&token=da67da7b-17c4-42ab-9d71-2009bceaf293', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, 'Chuyên khoa mắt', 'Khám chuyên sâu và điều trị hiệu quả các bệnh lý của mắt.\r\n    Khám phát hiện sớm và điều trị hiệu quả  các trường hợp bệnh lý cườm nước - tăng nhãn áp và cườm khô - đục thể thủy tinh .\r\n    Phối hợp liên chuyên khoa mắt và nội tiết để điều trị hiệu quả bệnh lý võng mạc do tiểu đường.\r\n    Đo khúc xạ - kính chính xác và tư vấn nhiều phương pháp điều trị chuyên sâu các bất thường khúc xạ của mắt.\r\n    Điều trị chảy nước mắt sống hiệu quả.\r\n    Điều trị hiệu quả các bệnh lý bề mặt giác mạc: như bệnh lý khô mắt, viêm kết mạc cấp tính hoặc mãn tính.      ', 'https://firebasestorage.googleapis.com/v0/b/pbl5-a1f37.appspot.com/o/images%2FavatarSpecialties%2Fchuyenkhoamat.png?alt=media&token=114c1957-81be-4a17-b38b-5628852050e4', '0000-00-00 00:00:00', '2024-05-12 23:35:13', '0000-00-00 00:00:00'),
